var ModalDemoCtrl = function ($scope, $modal, $log, $timeout, $element) {

  $scope.imgs = [
  	{
  		src: 'lib/imgs/1.jpg',
  		text: 'image 1'
  	},
  	{
  		src: 'lib/imgs/2.jpg',
  		text: 'image 2'
  	},
  	{
  		src: 'lib/imgs/3.jpg',
  		text: 'image 3'
  	},
  	{
  		src: 'lib/imgs/4.jpg',
  		text: 'image 4'
  	},
  	{
  		src: 'lib/imgs/5.jpg',
  		text: 'image 5'
  	},
    {
      src: 'lib/imgs/6.jpg',
      text: 'image 6'
    },
    {
      src: 'lib/imgs/7.jpg',
      text: 'image 7'
    },
    {
      src: 'lib/imgs/8.jpg',
      text: 'image 8'
    },
    {
      src: 'lib/imgs/9.jpg',
      text: 'image 9'
    }
 ];
  
  // Initialize slider when thumbnail is clicked
  $scope.slider = function(){
    $timeout(function() {
      $(".work_slides").responsiveSlides({
        auto: false,
        pager: false,
        random: true,
        nav: true,
        speed: 500,
      });
    }, 1);
  };

  $scope.open = function () {

    var modalInstance = $modal.open({
      templateUrl: 'img.html',
      controller: ModalInstanceCtrl,
      resolve: {
        imgs: function () {
          return $scope.imgs;
        }
      }
    });

    modalInstance.result.then(function (selectedImg) {
      $scope.selected = selectedImg;
    }, function () {
      $log.info('Modal dismissed at: ' + new Date());
    });
  };
};

// Please note that $modalInstance represents a modal window (instance) dependency.
// It is not the same as the $modal service used above.

var ModalInstanceCtrl = function ($scope, $modalInstance, imgs) {

  $scope.imgs = imgs; 
  $scope.selected = {
    img: $scope.imgs[0]
  };

  $scope.ok = function () {
    $modalInstance.close($scope.selected.img);
  };

  $scope.cancel = function () {
    $modalInstance.dismiss('cancel');
  };
};

 variable.controller('FormController',function($scope, $http) {
  // creating a blank object to hold our form information.
  //$scope will allow this to pass between controller and view
  $scope.formData = {};
  // submission message doesn't show when page loads
  $scope.submission = false;
  $scope.submitForm = function() {
    $http({
    method : 'POST',
    url : 'process.php',
    data : $.param($scope.formData), // pass in data as strings
    headers : { 'Content-Type': 'application/x-www-form-urlencoded' } // set the headers so angular passing info as form data (not request payload)
  })
    .success(function(data) {
      if (!data.success) {
       // if not successful, bind errors to error variables
       $scope.errorName = data.errors.name;
       $scope.errorEmail = data.errors.email;
       $scope.errorTextarea = data.errors.message;
       $scope.submissionMessage = data.messageError;
       $scope.submission = true; //shows the error message
      } else {
      // if successful, bind success message to message
       $scope.submissionMessage = data.messageSuccess;
       $scope.formData = {}; // form fields are emptied with this line
       $scope.submission = true; //shows the sucess message
      }
     });
   };
});
